import React from 'react'
import { Play } from '../Alies'

const Run: React.FC<{value:Play}> = ({value})=> {

    if (value.play_type==="Run"){
        return (
            <div>
              {value.carrier} run to {value.ball_place_result} {value.ball_on_result} for {value.yards_gained} yards. {value.result}.
            </div>
          )
    }
  return null
}

export default Run
